INSERT INTO regulation (regulation_id, regulation_name, target, pdf_file_path, regulation_description, expire_date, created_by_admin) VALUES
    (N'46E7424F-20B4-4DBD-84EC-52ADDBCF0938', N'Quy chế tuyển sinh và đào tạo Thạc sĩ', N'student', N'https://baygtczqmdoolsvkxgpr.supabase.co/storage/v1/object/public/regulations/Admission_and_Training_Regulations_for_Master''s_Programs.pdf', N'Quy định chi tiết về quy trình tuyển sinh, điều kiện dự tuyển, hình thức đào tạo, chương trình học, thời gian đào tạo, điều kiện tốt nghiệp và cấp bằng cho sinh viên theo học chương trình Thạc sĩ. Bao gồm các quy định về luận văn, hội đồng chấm luận văn, tiêu chuẩn đầu ra và quyền lợi của học viên cao học.', NULL, N'00000000-0000-0000-0000-000000000023'),
    (N'3F651559-F91D-4C47-802B-257EBA108B40', N'Quy chế tuyển sinh và đào tạo Thạc sĩ', N'instructor', N'https://baygtczqmdoolsvkxgpr.supabase.co/storage/v1/object/public/regulations/Admission_and_Training_Regulations_for_Master''s_Programs.pdf', N'Quy định chi tiết về quy trình tuyển sinh, điều kiện dự tuyển, hình thức đào tạo, chương trình học, thời gian đào tạo, điều kiện tốt nghiệp và cấp bằng cho sinh viên theo học chương trình Thạc sĩ. Bao gồm các quy định về luận văn, hội đồng chấm luận văn, tiêu chuẩn đầu ra và quyền lợi của học viên cao học.', NULL, N'00000000-0000-0000-0000-000000000023'),
    (N'4F949027-F3F5-478F-A9FB-66CF5F04262B', N'Quy định sử dụng cơ sở vật chất', N'student', N'https://baygtczqmdoolsvkxgpr.supabase.co/storage/v1/object/public/regulations/Regulations_on_the_Use_of_Facilities.pdf', N'Quy định về việc sử dụng và quản lý các cơ sở vật chất của trường bao gồm phòng học, giảng đường, thư viện, phòng thí nghiệm, phòng máy tính, khu thể thao, ký túc xá. Hướng dẫn đăng ký sử dụng, quy tắc ứng xử, bảo quản tài sản, xử lý vi phạm và trách nhiệm của sinh viên khi sử dụng các tiện ích chung của nhà trường.', NULL, N'00000000-0000-0000-0000-000000000023'),
    (N'9D7F1B78-B3AF-4910-BE9D-2B95954D49F5', N'Quy định sử dụng cơ sở vật chất', N'instructor', N'https://baygtczqmdoolsvkxgpr.supabase.co/storage/v1/object/public/regulations/Regulations_on_the_Use_of_Facilities.pdf', N'Quy định về việc sử dụng và quản lý các cơ sở vật chất của trường bao gồm phòng học, giảng đường, thư viện, phòng thí nghiệm, phòng máy tính, khu thể thao, ký túc xá. Hướng dẫn đăng ký sử dụng, quy tắc ứng xử, bảo quản tài sản, xử lý vi phạm và trách nhiệm của sinh viên khi sử dụng các tiện ích chung của nhà trường.', NULL, N'00000000-0000-0000-0000-000000000023'),
    (N'1A14F16F-EDEE-49FD-9557-D48BCBF42148', N'Quy định học phí và chính sách miễn giảm', N'student', N'https://baygtczqmdoolsvkxgpr.supabase.co/storage/v1/object/public/regulations/Tuition_Fees_and_Exemption_Policies.pdf', N'Quy định mức học phí theo từng ngành đào tạo, hình thức thanh toán, thời hạn nộp học phí, chính sách miễn giảm học phí cho sinh viên diện chính sách, sinh viên có thành tích học tập xuất sắc, sinh viên thuộc hộ nghèo, cận nghèo. Hướng dẫn thủ tục xin hoãn nộp học phí, xin hỗ trợ tài chính, vay vốn ngân hàng và các chế độ học bổng khác.', '2026-12-31', N'00000000-0000-0000-0000-000000000023'),
    (N'D7FB2C46-5876-432D-A771-34337572AF27', N'Quy định học phí và chính sách miễn giảm', N'instructor', N'https://baygtczqmdoolsvkxgpr.supabase.co/storage/v1/object/public/regulations/Tuition_Fees_and_Exemption_Policies.pdf', N'Quy định mức học phí theo từng ngành đào tạo, hình thức thanh toán, thời hạn nộp học phí, chính sách miễn giảm học phí cho sinh viên diện chính sách, sinh viên có thành tích học tập xuất sắc, sinh viên thuộc hộ nghèo, cận nghèo. Hướng dẫn thủ tục xin hoãn nộp học phí, xin hỗ trợ tài chính, vay vốn ngân hàng và các chế độ học bổng khác.', '2026-12-31', N'00000000-0000-0000-0000-000000000023'),
    (N'44CEE1C6-AC9B-45C7-9D0F-1159E4CB667F', N'Quy chế đào tạo đại học hệ chính quy', N'student', N'https://baygtczqmdoolsvkxgpr.supabase.co/storage/v1/object/public/regulations/Undergraduate_Training_Regulations.pdf', N'Quy định toàn diện về hệ thống đào tạo đại học chính quy bao gồm chương trình khung, phương thức tổ chức dạy và học, quy định về tín chỉ, đăng ký học phần, điều kiện dự thi, hình thức kiểm tra đánh giá, quy đổi điểm, xếp loại học lực. Các quy định về chuyển ngành, chuyển trường, tạm ngừng học, thôi học, điều kiện công nhận tốt nghiệp và cấp bằng tốt nghiệp đại học.', NULL, N'00000000-0000-0000-0000-000000000023'),
    (N'512FDA40-2511-472A-A7CC-E48D98217015', N'Quy chế đào tạo đại học hệ chính quy', N'instructor', N'https://baygtczqmdoolsvkxgpr.supabase.co/storage/v1/object/public/regulations/Undergraduate_Training_Regulations.pdf', N'Quy định toàn diện về hệ thống đào tạo đại học chính quy bao gồm chương trình khung, phương thức tổ chức dạy và học, quy định về tín chỉ, đăng ký học phần, điều kiện dự thi, hình thức kiểm tra đánh giá, quy đổi điểm, xếp loại học lực. Các quy định về chuyển ngành, chuyển trường, tạm ngừng học, thôi học, điều kiện công nhận tốt nghiệp và cấp bằng tốt nghiệp đại học.', NULL, N'00000000-0000-0000-0000-000000000023');
